import React from 'react';
import {
  GoogleMap,
  withScriptjs,
  withGoogleMap,
  Polygon
} from 'react-google-maps';
import { Drawer } from 'antd';
import axios from 'axios';

let key = 0;
let key2 = 0;

function Map({
  closeDrawer,
  openDrawer,
  currentDrawerState,
  mapPolygons,
  drawerInfos,
  center,
  polygonOptions,
  test
}) {
  //console.log(test);
  //console.log(center);
  //console.log(drawerInfos);

  //console.log(mapPolygons)
  //console.log(drawerInfos)
  //console.log(drawerInfos.img);
  //console.log(drawerInfos.services)

  var engBuildingCoords = [
    { lat: 37.3377, lng: -121.8815 },
    { lat: 37.3372, lng: -121.8825 },
    { lat: 37.3363, lng: -121.8819 },
    { lat: 37.3368, lng: -121.8809 }
  ];
  return (
    <GoogleMap
      defaultZoom={16}
      center={center}
      // center={{lat: 37.272040, lng: -121.861260}}
      options={{
        styles: [
          {
            elementType: 'labels',
            featureType: 'poi.business',
            stylers: [{ visibility: 'off' }]
          }
        ]
      }}
    >
      <div>
        {mapPolygons.map(mapPolygon => (
          <div key={key++}> {mapPolygon} </div>
        ))}
      </div>

      <Drawer
        className='drawer'
        title={drawerInfos.name}
        placement='left'
        closable={true}
        onClose={closeDrawer}
        visible={currentDrawerState}
      >
        {/* <h4>Charles W. Davidson College of Engineering</h4> */}
        <img src={require(`${drawerInfos.img}`)}></img>
        <p>{drawerInfos.desc}</p>
        <div>
          {drawerInfos.services.map(service => (
            <li key={key2++}> {service} </li>
          ))}
        </div>
      </Drawer>
    </GoogleMap>
  );
}

const WrappedMap = withScriptjs(withGoogleMap(Map));

export default WrappedMap;
